package com.rongke.model;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import java.io.Serializable;/** * @Blacklist * @黑名单库(blacklist) * @version : Ver 1.0 */@TableName("blacklist")public class Blacklist implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:主键id	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long id;	/**	 * @备注:姓名	 * @字段:user_name VARCHAR(55)	 */	private String userName;	/**	 * @备注:手机号	 * @字段:phone VARCHAR(55)	 */	private String phone;	/**	 * @备注:身份证号	 * @字段:id_card_number VARCHAR(55)	 */	private String idCardNumber;	public Blacklist(){	}	public Blacklist(		Long id	){		this.id = id;	}	public void setId(Long id) {		this.id = id;	}	public Long getId() {		return this.id;	}	public void setUserName(String userName) {		this.userName = userName;	}	public String getUserName() {		return this.userName;	}	public void setPhone(String phone) {		this.phone = phone;	}	public String getPhone() {		return this.phone;	}	public void setIdCardNumber(String idCardNumber) {		this.idCardNumber = idCardNumber;	}	public String getIdCardNumber() {		return this.idCardNumber;	}}